#ifndef CAN_VERSION_H_INCLUDED
#define CAN_VERSION_H_INCLUDED

/*==================[inclusions]============================================*/

#include <Can_Cfg.h>

/*==================[macros]================================================*/

/*------------------[AUTOSAR specification version identification]----------*/


#if (defined CAN_AR_RELEASE_MAJOR_VERSION) /* to prevent double declaration */
#error CAN_AR_RELEASE_MAJOR_VERSION already defined
#endif /* if (defined CAN_AR_RELEASE_MAJOR_VERSION) */

/** AUTOSAR specification major version */
#define CAN_AR_RELEASE_MAJOR_VERSION 4u

#if (defined CAN_AR_RELEASE_MINOR_VERSION) /* to prevent double declaration */
#error CAN_AR_RELEASE_MINOR_VERSION already defined
#endif /* if (defined CAN_AR_RELEASE_MINOR_VERSION) */

/** AUTOSAR specification minor version */
#define CAN_AR_RELEASE_MINOR_VERSION 2u

#if (defined CAN_AR_RELEASE_REVISION_VERSION) /* to prevent double declaration */
#error CAN_AR_RELEASE_REVISION_VERSION already defined
#endif /* if (defined CAN_AR_RELEASE_REVISION_VERSION) */

/** AUTOSAR specification patch version */
#define CAN_AR_RELEASE_REVISION_VERSION 2u


/*------------------[Cypress module version identification]----------------*/

#if (defined CAN_SW_MAJOR_VERSION) /* to prevent double declaration */
#error CAN_SW_MAJOR_VERSION already defined
#endif /* if (defined CAN_SW_MAJOR_VERSION) */

/** Driver implementation major version */
#define CAN_SW_MAJOR_VERSION 1u


#if (defined CAN_SW_MINOR_VERSION) /* to prevent double declaration */
#error CAN_SW_MINOR_VERSION already defined
#endif /* if (defined CAN_SW_MINOR_VERSION) */

/** Driver implementation minor version */
#define CAN_SW_MINOR_VERSION 17u


#if (defined CAN_SW_PATCH_VERSION) /* to prevent double declaration */
#error CAN_SW_PATCH_VERSION already defined
#endif /* if (defined CAN_SW_PATCH_VERSION) */

/** Driver implementation patch version */
#define CAN_SW_PATCH_VERSION CAN_CFG_PATCH_VERSION

/*------------------[Cypress module version identification]------------------*/
/**
 * Macro for checking the consistency of the software versions of the different files of the
 * CAN module
 */
 /* Deviation from MISRA-C:2004 Rule 19.7, MISRA-C:2012 Dir-4.9.
    Justification:  Allow compiler optimization. */
/* PRQA S 3453 6 */
#define CAN_SW_VERSION_CHECK( file_sw_major_version, file_sw_minor_version, file_sw_patch_version ) \
        (                                                                                           \
          (( CAN_SW_MAJOR_VERSION ) == ( file_sw_major_version )) &&                                \
          (( CAN_SW_MINOR_VERSION ) == ( file_sw_minor_version )) &&                                \
          (( CAN_SW_PATCH_VERSION ) >= 0)                                                           \
        )

/*==================[type definitions]======================================*/

/*==================[external function declarations]========================*/

#endif /*!defined(CAN_VERSION_H_INCLUDED)*/

